INSERT INTO `jobs_postings` (`id`, `title`, `dep_id`, `vacancies`, `type`, `experience`, `salary_min`, `salary_max`, `qualifications`, `status`, `date`, `expires`, `salary_period`, `currency`, `country`, `region`, `city`, `description`, `requirements`) VALUES
(6, 'Software Engineer', 38, 1, 'Contract', '2-3', '2500', '5000', 'Degree in Computer Science, Software Engineering, Information Management Systems, or a related discipline.', 'Unpublished', '2022-12-13 05:00:00', '2022-12-30', 'none', 'kwacha', 'Zambia', 'Lusaka', 'LUSAKA', '- Development of Web based and Mobile Applications.\r\n-Creating new applications or APIs to enhance existing applications\r\n-Enhancing applications by identifying opportunities for improvement, researching\r\nsolutions, making recommendations, designing, and implementing solutions\r\n-Troubleshoot, debug and upgrade existing systems\r\n-Database and application tuning\r\n-Managing and maintaining user/system documentation\r\n-Conducting end user training, support, and feedback evaluation\r\n-Assist others in the use of software engineering tools to support process\r\nimprovements.\r\n- Develop any other softwares required by the company.\r\n- Maintain existing softwares and perform customizations on softwares as per customers requirements.\r\n', '-Full grade twelve certificate with at least merit in Mathematics & English\r\n-Bachelor of Science Degree in Computer Science, Software Engineering,\r\nInformation Management Systems, or a related discipline.\r\n-3 to 5 years general software development and implementation\r\n-2 years working with Oracle PL/SQL, JAVA and Strong PL/SQL Programming\r\nskills. Oracle Database PL/SQL Developer Certification is an added advantage\r\n-Experience in writing Database Packages, Stored Procedures, Functions,\r\nTriggers, Views, and Objects/Collections in PL/SQL\r\n-Experience in multi-platforms such as Apex, PHP, VB.Net and JavaScript, React Technologies\r\n-Strong knowledge in Web Applications Design, Web Application Development\r\nand Sound documentation\r\n-Performance tuning. Databases: ORACLE 9i, 10g, 11g, 12c, MySQL, MS SQL\r\nServer\r\n-Ability to translate low level designs into programs/applications.\r\n-Familiarity with Functional Hierarchy Diagrams, Entity Relationship models and\r\nserver model design.\r\n-Ability to apply estimation techniques to software development efforts\r\n-Ability to effectively communicate your work with both technical and non-technical\r\npeers.\r\n\r\n\r\n'),
(7, 'Customer Centre Representative', 53, 1, 'Contract', '1', '1000', '3500', 'Diploma/Degree in a Commercial Discipline', 'Unpublished', '2022-06-01 04:00:00', '2022-06-30', 'monthly', 'kwacha', 'Zambia', 'LUSAKA PROVINCE', 'Lusaka', 'To handle all customer care interactions by providing consistent standards of service to Chesco tech customers, ensuring customer satisfaction, effective selling and to build and retain excellent customer relationships.\r\n\r\nâ€¢ Ensure Customer Satisfaction through consistent standards of service excellence through implementation of continuous improvement initiatives.\r\nâ€¢ Provide excellent customer relationship management by resolving customer queries, selling, retention and relationship building.\r\nâ€¢ Promote Chesco Tech brand image by managing service delivery aligned to customer needs and business objectives.\r\nâ€¢ Adhere to good work ethics.', 'A Degree or Diploma from a reputable firm.\r\nâ€¢ Customer Centric\r\nâ€¢ High level of commitment\r\nâ€¢ Ability and desire to sell\r\nâ€¢ High person standard and goal oriented\r\nâ€¢ Excellent interpersonal skills'),
(9, 'Data Science', 0, 3, 'Contract', '3', '2000', '3000', 'bachelors degree', 'Unpublished', '2023-07-05 05:00:00', '2023-08-31', 'none', 'kwacha', 'Afganistan', 'Lusaka', 'Lusaka', 'TEST 2', 'TEST 2'),
(10, 'SOFTWARE DEVELOPER', 38, 2, 'Contract', '3', '1000', '2000', 'DEGREE', 'Unpublished', '2023-07-05 05:00:00', '2023-07-31', 'monthly', 'kwacha', 'Zambia', 'LUSAKA', 'LUSAKA', 'SOFTWARE DEVELOPER', 'SOFTWARE DEVELOPER');
