(19, 44, 'People In Need Czech Republic', 'People In Need Czech Republic', '+260979433006', 'Nutrition Community Monitor', '2019-08-15', '2020-12-29', '1. Conducting trainings of community volunteers on CMAM and IYCF through Focus \r\nGroup Discussions(screening, referrals, follow-up on SAM treatment cases, etc.)\r\n2. Training members of the community in family MUAC (based on developments around \r\nCOVID-19)\r\n3. End-user monitoring in use of RUTF. Monitoring of household visits, screenings and \r\nreferrals conducted by community volunteers\r\n4. Monitoring the fieldwork of community volunteers including correct filling of project \r\nmonitoring sheets and their correct and timely submission\r\n5. Monitoring any barriers, including social and safeguarding issues with a strong gender \r\ncomponent, ensuring access to IMAM and IYCF services for women, girls and other \r\nvulnerable groups\r\n6. Organizing and facilitating monthly reporting community volunteer meetings and \r\nsubmitting resulting reports to Nutrition Supervisors\r\n7. Data collection for SQUEAC survey\r\n8. Community Feedback Response Mechanism promotion in the target communities\r\n9. Any other task as signed by the line manager', 'Certificate In Outpatient Therapeutic Programs.\r\nCertificate In Nutrition.', 'Project End.'),
