(4, 'test', 35, 1, 'Full Time', '1', '1', 'Funsani is a UK-based charity that supports Funsani Home, an orphanage in Kitwe, Zambia. The charity is led by volunteers who believe each child who has been orphaned to HIV deserves an education and support to live a healthy, productive life. Funsani was founded in 2002 by Dr Apakakombwele Chisuse-van der Boom, a UK-based doctor with roots in Zambia.\r\n\r\nFunsani is guided by our vision and mission statements:\r\n\r\nVision\r\nâ€œEvery child in Zambia impacted by HIV has the opportunity to achieve their full potential.â€\r\n\r\nMission\r\nâ€œOur mission is to provide a safe, caring environment through Funsani Home and our partnership network to support the wellbeing and education of vulnerable children impacted by HIV in Zambia.â€\r\n\r\nFunsani prides itself on providing children with a safe and caring home life. Many of the children we have supported over the years are now working in stable jobs. In the last year we have been focused on welcoming a new generation of children to Funsani Home. Currently we are supporting 9 children, aged between 4 and 9.\r\n\r\nKEY RESPONSIBILIT', '1', 'Published', '2023-05-08 22:00:00', '2023-05-31');
